import React from 'react';

import "./styles.css"
function Footer(){
    return (
    <section id="foot">
    <div className='elements'>
        <div className='rights'>
            <h1>hello</h1>
        </div>
        <div className='middle'>
        <h1>bye</h1>
        </div>
        <div className='leftside'>
        <h1>hi</h1>
        </div>
    </div>
    </section>
    )
}
export default Footer;
